css:
.nuclide-workspace-views-panel-location-tabs-hide-button-wrapper {
  display: flex;
  flex: 1;
  order: 9999;
  min-width: 45px;
  justify-content: flex-end;
  align-items: center;
  padding-right: 12.5px;
}
atom-pane-axis.horizontal > :not(:last-child) .nuclide-workspace-views-panel-location-tabs-hide-button-wrapper,
atom-pane-axis.vertical > :not(:first-child) .nuclide-workspace-views-panel-location-tabs-hide-button-wrapper {
  display: none;
}
.nuclide-workspace-views-panel-location-tabs-hide-button {
  cursor: default;
  font-size: 1em;
  width: 1.5em;
  height: 1.5em;
  line-height: 1.5;
  border-radius: 3px;
  overflow: hidden;
  transform: scale(0);
  transition: transform .08s;
}
.nuclide-workspace-views-panel-location-tabs-hide-button::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 12px;
  width: 12px;
  height: 12px;
  content: "\f0a3";
}
atom-panel.top .nuclide-workspace-views-panel-location-tabs-hide-button::before {
  content: '\f0a2';
}
atom-panel.left .nuclide-workspace-views-panel-location-tabs-hide-button::before {
  content: '\f0a4';
}
atom-panel.bottom .nuclide-workspace-views-panel-location-tabs-hide-button::before {
  content: '\f0a3';
}
atom-panel.right .nuclide-workspace-views-panel-location-tabs-hide-button::before {
  content: '\f078';
}
.nuclide-workspace-views-panel-location-tabs-hide-button:hover {
  color: #ffffff;
  background-color: #5282e0;
}
.nuclide-workspace-views-panel-location-tabs-hide-button:active {
  background-color: rgba(82, 130, 224, 0.5);
}
.nuclide-workspace-views-panel-location-tabs-hide-button::before {
  position: absolute;
  width: 1.5em;
  height: 1.5em;
  line-height: 1.5;
  text-align: center;
  pointer-events: none;
  font-size: 4em;
  transform: translate(-37.5%, -37.5%) scale(0.33);
}
.nuclide-workspace-views-panel {
  display: flex;
  flex: 1;
}
.nuclide-workspace-views-panel:hover .nuclide-workspace-views-panel-location-tabs-hide-button {
  transform: scale(1);
  transition-duration: 0.16s;
}
.theme-one-light-ui atom-panel .tab-bar .tab.active,
.theme-one-dark-ui atom-panel .tab-bar .tab.active {
  background-color: #21252b;
}
.theme-one-light-ui atom-panel .tab-bar .tab.active::after,
.theme-one-dark-ui atom-panel .tab-bar .tab.active::after {
  border-bottom-color: #21252b;
}
.theme-one-light-ui atom-panel .tab-bar .tab.active .title,
.theme-one-dark-ui atom-panel .tab-bar .tab.active .title {
  background-color: #21252b;
}
